import time
import logging
import requests
import sys
import base64


from bayeosdevice.device import DeviceController
from bayeosdevice.item import ItemDict

logging.basicConfig(format='%(asctime)s %(levelname)s:%(message)s', level=logging.DEBUG) 
logging.getLogger('bayeosdevice.device').setLevel(logging.INFO)


img_a = "data:image/jpeg;base64,"
img_b = "data:image/jpeg;base64,"

values = ItemDict({"camera1":img_a})  
actions = ItemDict({"run":True,"sleep_time":10})
components =  {
    '^camera': {'class':'Image','prop':{'alt':'Web Camera','width':400,'height':400}}, 
 }    

con = DeviceController(values,actions,components=components)
con.start()

i = 'a'
try:
    logging.debug("Starting device")
    while True:  
        if (actions["run"] == True):
            if (i == 'a'):
                logging.debug("Set image a")
                values['camera1'] = img_a
                i = 'b'
            else:
                logging.debug("Set image b")
                values['camera1'] = img_b
                i = 'a'
            time.sleep(actions["sleep_time"])            
        else:
            time.sleep(0.01)     
except KeyboardInterrupt:
    con.stop()
finally:
    logging.debug("Stopped device")